import React from "react";
import { Link } from "react-router-dom";

export  function Navbar() {
    return (
      <>
        <Link to ='/about'>About</Link>
        <Link to ='/locations'>Locations</Link>
        <Link to ='/join'>Join</Link>            
     </>
  );
}

export default Navbar;
